// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract DocumentVerification {

    struct Document {
        address issuer;
        uint256 timestamp;
        bool isValid;
    }

    mapping(bytes32 => Document) public documents;

    // Fungsi untuk menerbitkan dokumen (menyimpan hash)
    function issueDocument(bytes32 docHash) external {
        require(!documents[docHash].isValid, "Document already exists");

        documents[docHash] = Document({
            issuer: msg.sender,
            timestamp: block.timestamp,
            isValid: true
        });
    }

    // Fungsi untuk verifikasi dokumen
    function verifyDocument(bytes32 docHash) external view returns (bool, address, uint256) {
        Document memory doc = documents[docHash];
        return (doc.isValid, doc.issuer, doc.timestamp);
    }
}

